import React, { useEffect} from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { loadItemGroups } from '../../store/ItemGroups.actions' ;
import ItemGroupsPage from './ItemGroups';


function Home() {
    const dispatch = useDispatch();
    const { itemGroups } = useSelector(state => state.itemGroup);
    useEffect(() => {{
            dispatch(loadItemGroups()).unwrap()
            .then((itemGroup) => {
                const itemGroupslist = itemGroup.map(ig => {
                    id: ig.id;
                    igname: ig.name;
                    description: ig.description;
                })
                return itemGroupslist;
            })
            
        }
    }, [dispatch]);

    return (
        <div className='Home'>
            <h1>Welcome to Emil's Quality Honey and Bee Product Specialities!</h1>
            <h5>(Since 2024!)</h5>
            <h3>Every product is organic and intimately fostered by farmer Emil. Have a look:</h3>
            <div className="itemGroupWrapper">
                <p>{itemGroupslist.id}</p>
                <p>{itemGroupslist.igname}</p>
                <p>{itemGroupslist.description}</p>
            </div>
        </div>
    );
};

export default Home;
